import classes from "./Header.module.css";
import CartButton from "./HeaderCartButton";

function Header() {
  return (
    <React.Fragment>
      <header className={classes.header}>
        <h1>Paki Meals</h1>
        <CartButton itemCount="0"></CartButton>
      </header>
      <div className={classes[main - image]}></div>
    </React.Fragment>
  );
}

export default Header;
